import macCrest from './images/mcmaster/macCrest.png';
import './App.css';

function App() {

  const Navbar = () => {
    return (
        <div className="w-full bg-white">
            <div className="w-6/12 pl-6 flex py-3 gap-4">
                <img src={macCrest} className="w-8" />
                <div className="flex flex-col gap-0">
                    <h1 className="text-lg">2022-23 Capstone Project - Roadside Object Detection</h1>
                    <h1 className="text-md text-slate-500">by Nihal Azavedo, Tinson Chen, Joe Furfaro</h1>
                </div>
            </div>
        </div>
    );
  }

  return (
    <Navbar />
  );
}

export default App;
